import React, { Component } from 'react';
import './Visualize1.css';

class Visualize1 extends Component {

  constructor(props){
    super(props);
  }


  removeVis(instruction){
    setTimeout(
      this.props.removeVis(instruction), 
      60/this.props.bpm
    )
  }

  render() {
    return (
      <div class="loader">
        <span class="loader__inner"></span>
        <span class="loader__inner"></span>
        {this.removeVis(1)}
      </div>
    );
  }
}

export default Visualize1;
